import React from 'react';
import Link from 'next/link';
import Wrapper from './Logo.styled';

type LogoProps = {
  path: string | any;
  src: string;
  style?: React.CSSProperties;
};

const Logo = ({ path, src, style }: LogoProps) => {
  return (
    <Link href={path}>
      <Wrapper className="logo" style={style}>
        <img src={src} alt="Inst." />
      </Wrapper>
    </Link>
  );
};

export default Logo;
